import React from "react";
const name = "Noe Rios";
const bio = {
  hobbies: "Love nick jonas",
  weight: 160
};

const stripVowels = (name) => {
  const vowels = ["a", "e", "i", "o", "u"];
  let results = "";

  for(let index = 0; index < name.length; index++) {
    if(vowels.includes(name[index])) {
      results += name[index];
    }
  }

  return results;
}

